import java.util.*;
import java.io.*;

public class Main {
    static class TrieNode {
        Map<Character, TrieNode> children;
        boolean end;

        TrieNode() {
            children = new HashMap<>();
            end = false;
        }
    }

    static class Trie {
        TrieNode root;

        Trie() {
            root = new TrieNode();
        }

        void insert(String s) {
            TrieNode node = root;
            for (char c : s.toCharArray()) {
                if (!node.children.containsKey(c)) {
                    node.children.put(c, new TrieNode());
                }
                node = node.children.get(c);
            }
            node.end = true;
        }

        boolean contains(String s) {
            TrieNode node = root;
            for (char c : s.toCharArray()) {
                if (!node.children.containsKey(c)) {
                    return false;
                }
                node = node.children.get(c);
            }
            return node.end;
        }

        String findMin() {
            PriorityQueue<TrieNode> pq = new PriorityQueue<>((a, b) -> a.end ? -1 : b.end ? 1 : a.children.size() - b.children.size());
            pq.offer(root);
            StringBuilder sb = new StringBuilder();
            while (!pq.isEmpty()) {
                TrieNode node = pq.poll();
                if (node.end) {
                    sb.append(sb.length() == 0 ? "" : "?").append(node.children.keySet().iterator().next());
                }
                for (char c : node.children.keySet()) {
                    pq.offer(node.children.get(c));
                }
            }
            return sb.toString();
        }
    }

    public static void main(String[] args) throws IOException {
        BufferedReader br = new BufferedReader(new InputStreamReader(System.in));
        String s = br.readLine();
        String t = br.readLine();
        Trie trie = new Trie();
        for (int i = 0; i <= t.length() - s.length(); i++) {
            String sub = t.substring(i, i + s.length());
            trie.insert(sub);
        }
        String ans = trie.findMin();
        if (ans.equals("?")) {
            System.out.println("UNRESTORABLE");
        } else {
            System.out.println(ans);
        }
    }
}
